import React from "react";
export default function Input(props) {
    return (
        <>
            <input
                className="input"
                placeholder="Введіть ... "
                value={props.value}
                onChange={(e) => props.setValue(e.target.value)}
                title="Разрешено не более 5 цифр" pattern="[0-9]{1,2}"
            />
        </>
    )
}
